import React from 'react'
import { AppBar, styled, Typography } from "@mui/material"
import { Toolbar } from '@mui/material';
import App from '../App'
import { Box, flexbox } from '@mui/system'
import AcUnitIcon from '@mui/icons-material/AcUnit';
import {  alpha } from '@mui/material/styles';
import InputBase from '@mui/material/InputBase';
import Badge from '@mui/material/Badge';
import MailIcon from '@mui/icons-material/Mail';
import Notifications from '@mui/icons-material/NotificationAdd';
import Avatar from '@mui/material/Avatar';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';


const StyledToolBar = styled(Toolbar)({
    display:"flex",
    justifyContent:"space-between"
})

const Search = styled('div')(({ theme }) => ({
    position: 'relative',
    backgroundColor:"white",
    padding:"0 10px",
    borderRadius:theme.shape.borderRadius,
    width:"40%"
  }));

const Icons = styled(Box)(({ theme }) => ({
    display:"none",
    
    color:"white",
    gap:"20px",
    alignItems:"center",
    [theme.breakpoints.up("sm")]:{
        display:"flex"
    }
    
  }));

const UserBox = styled(Box)(({ theme }) => ({
    
    display:"flex",
    gap:"10px",
    alignItems:"center",
    [theme.breakpoints.up("sm")]:{
        display:"none"
    }
    
  }));

function Navbar() {
  return (
    <AppBar position='stick'>
        <StyledToolBar>
            <Typography variant='h6' sx={{ display: {xs:"none",sm:"block"}}}>Travelog</Typography>
            <AcUnitIcon sx={{ display: { xs:"block",sm:"none"} }}/>
            <Search><InputBase placeholder='Search...'/></Search>
            <Icons>
                <Badge badgeContent={4} color="error">
                <MailIcon color="action" />
                </Badge>
                <Badge badgeContent={4} color="error">
                <Notifications color="action" />
                </Badge>
                <Avatar sx={{width:30,height:30}} alt="Remy Sharp" src="/static/images/avatar/1.jpg" />
            </Icons>

            <UserBox>
                <Avatar sx={{width:30,height:30}} alt="Remy Sharp" src="/static/images/avatar/1.jpg" />
                <Typography variant="span">John</Typography>

            </UserBox>
            
        </StyledToolBar>
        <Menu
        id="basic-menu"
        open={true}
        anchorOrigin={{
            vertical:'10px',
            horizontal:'right'
        }}
        transformOrigin={{
            vertical:'top',
            horizontal:'left'
        }}
        MenuListProps={{
          'aria-labelledby': 'basic-button',
        }}
      >
        <MenuItem >Profile</MenuItem>
        <MenuItem >My account</MenuItem>
        <MenuItem >Logout</MenuItem>
      </Menu>
        
    </AppBar>
  )
}

export default Navbar
